import React from 'react';
import './App.css'; // CSS dosyasını import ettiğimizden emin olalım

const Page5 = () => {
  return (
    <div className="page5-container">
     
        <div>
          <p >merhaba</p>
          <p >Matemask Accounts</p>
        </div>
        <div>
          <p >dünya</p>
          <p >Twitter Accounts</p>
        </div>
        <div>
          <p >ahmet</p>
          <p >Telegram Accounts</p>
        </div>
     
      <p className='page5first'>BUT<span className='space'>_</span>STILL<span className='space'>_</span>123123</p>
      <h1 className='page5second'>UNIQUE<span className='space'>_</span> USERS</h1>
    </div>
  );
}

export default Page5;
